window.bookSummaryJSON = "<p>After months of searching, Ember and her friends have finally located the Sword of Light, the only weapon capable of killing Queen Aneira and ending her rule. This is Ember's destiny. Or so she thought. Now a pact to save the man she loves changes everything. </p> <p>One thing which hasn't changed is Ember's undeniable connection to Eli Dragen, who is sexy, gorgeous, and even more frustrating. But her problems go way beyond him. Even their love might not be able to withstand the truth. </p> <p>As the war mounts between the Seelie and Unseelie (Light and Dark), deep secrets are finally revealed, ripping Ember's world and heart apart. And what Aneira steals from Ember won't just destroy Ember, but the entire human world. </p> <p>In this final installment, the fight for Earth has begun. Ember must go beyond anything she could ever imagine and make the ultimate sacrifice to save millions of innocent lives. </p> <p>But the price may be too high - even for her. </p>"; 
